import React from 'react';
import addClass from '../hoc/AddClass/AddClass';

type paginationProps = {
    pages: number[]
    class?: string
    clicked: {}
};

const Pagination: React.FC<paginationProps> = (props) => {
    return<React.Fragment>
        <button onClick={() => props.clicked}>Previous</button>
        {props.pages.map((page, i) => (
            <button className={props.class} key={i}>{page}</button>
        ))}
        <button onClick={() => props.clicked}>Next</button>
    </React.Fragment>
};

export default addClass(Pagination, 'pagination');
